import React from 'react';

const About = () => {
  return (
    <div className="page-container">
      <h1>About Guide Nepal</h1>
      <p>
        Guide Nepal is a platform dedicated to revolutionizing tourism in Nepal by connecting travelers with 
        authentic local experiences and empowering communities.
      </p>
    </div>
  );
};

export default About;
